import React from 'react';

// CSS:
import '../CSS/AllCards.scss';

const AllCards = () => {
    return (
        <div className="AllCards_container">
            <div className="Allcards_box">
                <div className="AllCards_list">CARD LIST</div>
                <div className="AllCards"></div>
            </div>
        </div>
    )
}

export default AllCards;
